import './Choice.css'

import { Col, Container, Row } from 'react-bootstrap'

function Choice(){

    const ArraysOfChoice = [{
        id: 1,
        title: 'Hello world',
        text: 'Lorem ipsum dolor'
    },
    {
        id: 2,
        title: 'Hello world',
        text: 'Lorem ipsum dolor'
    },
    {
        id: 3,
        title: 'Hello world',
        text: 'Lorem ipsum dolor'
    }
    ]
    const ArraysOfChoiceOnMap = ArraysOfChoice.map((ArrayOfChoice) => 
    <Col key = {ArrayOfChoice.id} lg = "4" md = "6" sm = "12">
        
        <svg xmlns="http://www.w3.org/2000/svg" width="40" height="40" fill="currentColor" class="bi bi-arrow-up-square" viewBox="0 0 16 16">
            <path fill-rule="evenodd" d="M15 2a1 1 0 0 0-1-1H2a1 1 0 0 0-1 1v12a1 1 0 0 0 1 1h12a1 1 0 0 0 1-1V2zM0 2a2 2 0 0 1 2-2h12a2 2 0 0 1 2 2v12a2 2 0 0 1-2 2H2a2 2 0 0 1-2-2V2zm8.5 9.5a.5.5 0 0 1-1 0V5.707L5.354 7.854a.5.5 0 1 1-.708-.708l3-3a.5.5 0 0 1 .708 0l3 3a.5.5 0 0 1-.708.708L8.5 5.707V11.5z"/>
        </svg>
        
        <h1>{ArrayOfChoice.title}</h1>
        <p>{ArrayOfChoice.text}</p>
    </Col>
    )

    return(
        <Container fluid>
            <Container>
                <div>
                    <h1>Changing real estate for the better</h1>
                </div>

                <Row>
                    {ArraysOfChoiceOnMap}
                </Row>
            </Container>
        </Container>
    )
}

export default Choice
